"""Tivemos uma ligeira melhora em relação a apenas o XGB, mas ainda da para ajustar algumas coisas:

### 6.5 Ajustes para tentar melhorar o ensemble:

### 6.4.1 Balanceamento das classes (SMOTE ou class_weight “real”)
"""

from imblearn.over_sampling import SMOTENC

# cat_cols você já tem de antes: ['plot', 'genus', 'species_clean', 'season_wa']

categorical_indices = [X_train.columns.get_loc(col) for col in cat_cols]
categorical_indices

sm = SMOTENC(
    categorical_features=categorical_indices,
    random_state=42
)

X_train_bal, y_train_bal = sm.fit_resample(X_train, y_train)

print("Antes:", X_train.shape, y_train.value_counts(normalize=True))
print("Depois:", X_train_bal.shape, y_train_bal.value_counts(normalize=True))

"""### 6.4.2 Ajustar o threshold"""

import numpy as np
from sklearn.metrics import f1_score

probs = ensemble_final.predict_proba(X_test)[:, 1]

thresholds = np.arange(0.1, 0.9, 0.01)
best_thr = 0
best_f1 = 0

for thr in thresholds:
    preds_thr = (probs >= thr).astype(int)
    f1 = f1_score(y_test, preds_thr)
    if f1 > best_f1:
        best_f1 = f1
        best_thr = thr

best_thr, best_f1

"""### 6.5 Ensemble Balanceado:"""

thr_bal = best_thr  # ou simplesmente thr_bal = 0.49

probs_bal = ensemble_final.predict_proba(X_test)[:, 1]
y_pred_opt_bal = (probs_bal >= thr_bal).astype(int)

from sklearn.metrics import accuracy_score, precision_score, recall_score, f1_score, classification_report

print("=== Ensemble com SMOTE + Threshold ótimo ===")
print("Threshold:", thr_bal)
print("Acurácia :", accuracy_score(y_test, y_pred_opt_bal))
print("Precisão :", precision_score(y_test, y_pred_opt_bal))
print("Recall   :", recall_score(y_test, y_pred_opt_bal))
print("F1       :", f1_score(y_test, y_pred_opt_bal))
print("\nRelatório completo:\n", classification_report(y_test, y_pred_opt_bal))

"""Após aplicar o SMOTENC para balancear as classes e recalibrar o limiar de decisão, foi possível observar um aumento no recall da classe sobrevivente, indicando que o modelo passou a identificar uma parcela maior das mudas que realmente sobrevivem. No entanto, essa melhora veio acompanhada de uma redução na precisão e em uma leve queda no F1-score, sugerindo que o conjunto sintético criado pelo SMOTE introduziu ruído e aumentou a taxa de falsos positivos.

Apesar de o ensemble balanceado apresentar um desempenho razoável, o ensemble original — treinado sem SMOTE e com threshold otimizado — demonstrou métricas mais equilibradas e maior estabilidade, sendo capaz de capturar melhor as nuances reais do conjunto de dados sem depender de exemplos artificiais.

Por esse motivo, optei por utilizar como modelo final o ensemble inicial, que apresentou o melhor compromisso entre precisão, recall e F1-score, além de refletir de forma mais fiel os padrões naturais presentes no sistema ecológico analisado.

## 7. Interpretação com Explainable AI (SHAP e PDP)

Para compreender como o ensemble final toma suas decisões e identificar os fatores que mais influenciam a sobrevivência das mudas, utilizamos a abordagem de Explainable AI (XAI). Como o `VotingClassifier` não é diretamente compatível com SHAP, adotamos o XGBoost tunado dentro do ensemble como modelo-base para interpretação, uma vez que ele é o modelo dominante na etapa de votação e possui suporte nativo ao método.

Os gráficos de SHAP permitem analisar o impacto individual e global de cada variável na previsão, revelando quais fatores aumentam ou reduzem a probabilidade de sobrevivência. Além disso, os plots de dependência (PDP) ajudam a entender como o efeito de cada variável muda em diferentes faixas de valores.

Essa análise é essencial para transformar o modelo em uma ferramenta de tomada de decisão, pois fornece subsídios interpretáveis que auxiliam no manejo e planejamento das áreas, indicando quais atributos do microclima, manejo e composição influenciam diretamente a performance das mudas.

### 7.1 7.1. Preparando o SHAP Explainer
"""

import shap

# Ativar visualizações JS no notebook
shap.initjs()

# Pegar o XGBoost dentro do pipeline (já tunado)
xgb_only = best_xgb.named_steps["clf"]

# Pegar o preprocessador
prep = best_xgb.named_steps["prep"]

# Transformar o X_train para o espaço numérico já codificado
X_train_prepped = prep.fit_transform(X_train)

# Criar o SHAP TreeExplainer para XGBoost
explainer = shap.TreeExplainer(xgb_only)
shap_values = explainer.shap_values(X_train_prepped)

"""### 7.2 Feature Importance Global (SHAP Summary Plot)"""

# Summary plot das importâncias (efeitos médios)
shap.summary_plot(shap_values, X_train_prepped, feature_names=prep.get_feature_names_out())

"""O gráfico de SHAP evidencia que a sobrevivência das mudas é fortemente influenciada por variáveis relacionadas ao microclima e à competição no ambiente de plantio. A presença de banana - bananeiras (Musa sp.), surge como o fator mais determinante, com valores mais altos associados a efeitos positivos na predição, possivelmente por fornecer sombreamento e estabilidade térmica. Em contraste, variáveis como delay, panicum e cedrela tendem a reduzir a probabilidade de sobrevivência quando elevadas, refletindo estresse inicial, competição por recursos e interferência na luz ou umidade. Também se destacam os efeitos dos gêneros vegetais presentes no entorno, indicando que a composição florística modula o microambiente de forma relevante. Além disso, padrões espaciais revelados pelas coordenadas (x e y) sugerem heterogeneidade no viveiro, com quadrantes mais favoráveis que outros. No conjunto, o modelo identifica que a sobrevivência não depende de um único fator isolado, mas da interação entre manejo, competição e características ambientais locais, reforçando a natureza complexa e multifatorial desse processo ecológico.

### 7.3 Dependence Plots (efeito de variáveis específicas)
"""

important_features = prep.get_feature_names_out()

# Escolha algumas features importantes (você pode trocar pelos nomes que quiser)
features_to_plot = [
    important_features[0],
    important_features[1],
    important_features[2],
    important_features[3],
]

# Converter a matriz esparsa para densa (se for muito grande, podemos amostrar depois)
if hasattr(X_train_prepped, "toarray"):
    X_train_dense = X_train_prepped.toarray()
else:
    X_train_dense = X_train_prepped

# Se shap_values veio como lista (caso raro em binário), pegar a classe positiva
shap_vals_for_plot = shap_values[1] if isinstance(shap_values, list) else shap_values

for feat in features_to_plot:
    shap.dependence_plot(
        feat,
        shap_vals_for_plot,
        X_train_dense,
        feature_names=important_features
    )

"""Os gráficos SHAP de cat_plot_1, cat_plot_2 e cat_plot_3 mostram que a localização espacial das parcelas exerce influência relevante sobre a sobrevivência, mas com padrões distintos entre áreas. No plot 1, observa-se que as parcelas codificadas como “1” apresentam impacto consistentemente positivo na predição, especialmente quando associadas a valores altos de banana, indicando que essa região do viveiro tende a oferecer microclima mais favorável quando combinada com sombreamento. No plot 2, os valores positivos concentram-se também nas parcelas “1”, mas a intensidade do efeito depende da distância ao centro: pontos mais próximos (cores mais frias) tendem a gerar impactos neutros ou levemente positivos, enquanto distâncias maiores (cores mais quentes) reduzem o efeito benéfico, sugerindo heterogeneidade ambiental dentro do próprio bloco. Já o plot 3 apresenta impacto predominantemente negativo para a maior parte das observações na parcela “1”, especialmente quando associadas à presença do gênero Ricinodendron, o que sugere que a combinação específica de vegetação circundante e microclima nessa área tende a desfavorecer a sobrevivência das mudas. Em conjunto, os três gráficos revelam que o efeito espacial não é homogêneo: cada parcela contribui de forma diferente para o modelo, reforçando a importância do posicionamento no viveiro e da interação entre sombra, competição e espécies vizinhas.

No caso de cat_plot_4, observa-se um padrão marcadamente negativo sempre que a parcela está codificada como “1”, indicando que essa área específica do viveiro está associada a condições menos favoráveis para a sobrevivência das mudas. Os valores de SHAP nessa categoria são majoritariamente inferiores a zero e, em vários pontos, bastante negativos, o que sugere impacto consistente e significativo na redução da probabilidade prevista de sobrevivência. A coloração dos pontos, representando o gênero Khaya, mostra que tanto presença quanto ausência desse gênero aparecem distribuídas em regiões negativas do eixo SHAP, indicando que o efeito

### 7.4 SHAP Force Plot (interpretação de uma observação específica)
"""

